import React from 'react';
export default class FetchData extends React.Component {
    state = {
        loading: true,
        app: null,
    }
    async componentDidMount() {
        const response = await fetch('https://api.npoint.io/54d09df281f91e8c146f')
        const data = await response.json();
        console.log(data)
        this.setState({ loading: false, app: data })

    }
    render() {
        return (
            <div>
                { this.state.loading || !this.state.app ? <div>Loading</div> : <div>{this.state.app}</div>}
            </div>
        );
    }
}
